import React, { useEffect, useState } from 'react';
import { fetchInfluence } from '../services/api';

function InfluencePage() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchInfluence().then(res => {
      setData(res.data);
    });
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2>Influence Ranking</h2>
      <table border="1" cellPadding="5" cellSpacing="0">
        <thead>
          <tr>
            <th>Community</th>
            <th>Author</th>
            <th>Intra PR</th>
            <th>Community PR</th>
            <th>Total Influence</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, idx) => (
            <tr key={idx}>
              <td>{row.community_id}</td>
              <td>{row.author}</td>
              <td>{(row.intra_pagerank ?? 0).toFixed(5)}</td>
              <td>{(row.community_pagerank ?? 0).toFixed(5)}</td>
              <td>{(row.total_influence ?? 0).toFixed(5)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default InfluencePage;
